import React from "react";

function Icon(props){
 return  (
    <div 
      style = {{color: props.color, cursor: "pointer"}}   className="my-tooltip">
        <i className ={props.typeIcon}></i>
        <span className="my-tooltiptext">{props.toolTipText}</span>
    </div>);
};

export default Icon;
